import React from "react";
import "../Styles/Home.css";
import about_us from "../Images/about_us.jpg";

function Home() {
  return (
    <div>
      <div className="about-us">
        <h2>ABOUT US</h2>
        <div className="about-us-flexcontainer">
          <img src={about_us} className="about-us-pic"></img>
          <div className="about-us-text">
            SK Engineering Solutions LLC evolved with the simple idea of serving
            customers with the best products at competitive prices. With over 5
            decades of experience in precision machining, Casting and Forging,
            we have the capability to meet all the customer needs. Our pillar
            for success lies in our enthusiasm for innovative solutions to serve
            customers. At SK Engineering Solutions LLC., we always engage in
            learning and implementing newer technology for constant optimization
            of our products.
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
